import React from 'react';


const Cards = (props) => {
    return (<div>
        
        <h1>soy tarjeta</h1>

        <section>
            <img src="{props.}" alt="imagen de producto" />
        </section>

        <p>{props.descripcion}</p>

        <div>
            <h2>{props.name}</h2>
            <h4>$ {props.price}</h4>
        </div>

        <span>{props.ammount}</span>

    </div>
    );
}

export default Cards;
